const SubmitButton: FC = () => {
    //  1:  useFormStatus    
    const { pending } = useFormStatus();

    return (
        <button
            type='submit'
            className='btn'
            disabled={pending}
            aria-disabled={pending}
        >
            {pending ? '...' : ''}
        </button>
    );
};

//   
const ProgressIndicator: FC = () => {
    //  2:  useFormStatus    
    const { pending } = useFormStatus();

    if (!pending) return null;

    return (
        <div className='progress-bar'>
            <div className='progress-indicator'></div>
        </div>
    );
};

